import VIP from "./../../../../media/sali/VIP.png";
import categoria1 from "./../../../../media/sali/1.png";
import categoria2 from "./../../../../media/sali/2.png";
import categoria3 from "./../../../../media/sali/3.png";
import categoria4 from "./../../../../media/sali/4.png";

const tickets = {
  products: [
    {
      id: "0",
      name: "Categ. V.I.P.",
      price: 702,
      image: VIP,
    },

    {
      id: "1",
      name: "Categoria 1",
      price: 670,
      image: categoria1,
    },

    {
      id: "2",
      name: "Categoria 2",
      price: 595,
      image: categoria2,
    },

    {
      id: "3",
      name: "Categoria 3",
      price: 510,
      image: categoria3,
    },

    {
      id: "4",
      name: "Categoria 4",
      price: 455,
      image: categoria4,
    },
  ],
};

export default tickets;
